import React, { Component } from "react";
import Row from "react-bootstrap/Row";
import Scissors from "./Scissors";

export default class GameOptions extends Component {
  render() {
    return (
      <Row>
        <Rock></Rock>

        <Paper></Paper>

        <Scissors></Scissors>
      </Row>
    );
  }
}
